jobDescription:
#Mobile Sales Application (MSA) Engineer

#CRM, Integrated Business Solution Back Office engineer 


@Zain KSA Project

• Administration des réseaux et des Firewalls: FortiGate; 
• Sécurité des serveurs de messageries via des solutions anti-spam: MailInBlack; 
• Analyse et détection des vulnérabilités: Tenable SC, Nessus, FortiAnayzer; 
• Gestion et assurance de la haute disponibilité des services via les solutions de Backup et Réplication;
• Virtualisation : VMware, Hyper-V; 
• Audit continue et périodique des solutions; 
• Réunion et organisation des projets en équipe; 
• Rédaction des fiches recettes et investigation.

jobDescription2:
•  Analyste et Intégrateur SPLUNK :
- Création des nouvelles sources de logs (Firewall, universal forwarder, SNMP, syslog, etc.);
- Développement des scripts python;
- Développement des requêtes SPL;
- Développement des parseurs spécifiques;
- Normalisation des logs;
- Création d’alertes, des dashboards, lookup orientés client;
- Création des rapports;
- Création et configuration des règles de sécurité;
- Rédaction des documentations;
- Réunion et organisation des projets en équipe.

•  Autre Fonctionnalités du poste :
- Traçabilité et contrôle d'identité avec One identity & Wallix,
- Administration, gestion et configuration des firewalls : Fortinet, PaloAlto;
- Audit des applications WEB à l’aide de Rapid7, AppSpider;
- Analyse des vulnérabilités Web, Système (AD, Linux, Windows) et Réseau;
- Analyse du besoin client et rédaction des SFD;
- Virtualisation : VMware, Hyper-V;
- Mise en place, déploiement et configuration de solution MFA (Multi-factor authentification)[ESA], [FortiToken]
